import React from 'react';
const Main = () => {
  const firstName = `Steven`;
  const lastName = `Yoh`
  return (
    <div className="main-home">
      <div>
        <button>Say Hi</button>
        <p>{firstName}</p>
        <p>{lastName}</p>
      </div>
    </div>
  )
}

export default Main;
